import React from 'react';
import Logo from '../Logo/Logo';
import BackButton from '../BackButton/BackButton';
import './TopNavBar.css';

const TopNavBar = () => {
    return (
        <div className="topNavBar">
            <Logo />
            <BackButton />
        </div>
    );
};

export default TopNavBar;
